SELECT name
FROM author
WHERE oid IS NULL;

SELECT title
FROM publication
ORDER BY title ASC;

SELECT EXTRACT(DAY
               FROM CURRENT_DATE - MAX(admit_term)) AS days_since_last_admitted_student
FROM student;

SELECT AVG(EXtract('day'
                   FROM predicted_graduation_semester - admit_term)) AS avg_predicted_time_to_graduation
FROM student;

SELECT name
FROM course
WHERE department = 'Computer Science';

SELECT c.course_id,
       (c.helpfulness_score / c.clarity_score) AS helpfulness_to_clarity_ratio
FROM course AS c;

SELECT EXTRACT(DAY
               FROM AGE(CURRENT_DATE, MIN(departure_time::TIMESTAMP))) AS diff_in_days
FROM flight;

SELECT MIN(EXTRACT(HOUR
                   FROM TIMESTAMP WITHOUT TIME ZONE departure_time)) AS earliest_departure_time
FROM flight;

SELECT COUNT(*)
FROM fare
WHERE round_trip_required = 'Yes';

SELECT MIN(minimum_connect_time)
FROM airport
WHERE airport_code = 'JFK';

SELECT state_code
FROM airport
WHERE airport_name = 'Orlando International Airport';

SELECT fare_id,
       (one_direction_cost / round_trip_cost) AS ratio_of_one_way_to_round_trip
FROM fare;

SELECT river.river_name
FROM river
WHERE LENGTH(river.traverse) >= 3;

SELECT s.state_name
FROM state s
WHERE s.population < 100000;

SELECT s.state_name,
       (s.population::float / s.area) AS population_per_area_ratio
FROM state s;

SELECT name
FROM restaurant
WHERE food_type = 'Italian';

SELECT (COUNT(*) FILTER (
                         WHERE rating > 4.5)::FLOAT / COUNT(*)) AS ratio_of_highly_rated_restaurants
FROM restaurant;

SELECT journalname
FROM journal
ORDER BY LENGTH(journalname);

SELECT name
FROM business
ORDER BY name ASC;
